import React from 'react'
import styled from 'styled-components'

const Block = styled.div`
  background: grey;
  font-size: 1.25rem;
  text-align: center;
  border-radius: 2rem;
  max-width: 20rem;
  align-self: center;
`

const StatBlock = ({ title, data }) => {
  return (
    <Block>
      <h3>{title}:</h3>
      <span>{data}</span>
    </ Block>
  )
}

export default StatBlock;
